sources.styles/header.scss:
.header {
  margin-bottom: 100px;
  position: relative;

  @include onTablet {
    margin-bottom: 130px;
  }

  @include onDesktop {
    margin-bottom: 0;
    padding-bottom: 253px;

    &::after {
      content: "";
      position: absolute;
      bottom: 0;
      left: 0;
      width: 40vw;
      border-bottom: 1px solid rgba(52, 79, 16, 0.5);
    }
  }

  &__top-actions {
    margin-bottom: 0;

    @include onTablet {
      margin-bottom: 0;
    }

    @include onDesktop {
      margin-bottom: 50px;
    }
  }

  &__content {
    position: relative;

    &-title {
      font-weight: 600;
      font-size: 24px;
      line-height: 130%;
      text-align: center;
      color: $blackTextColor;

      margin-bottom: 10px;

      @include onTablet {
        font-size: 36px;
        line-height: 150%;
        text-align: center;
        text-transform: capitalize;
      }

      @include onDesktop {
        font-size: 60px;
        line-height: 130%;
        text-align: left;
        margin-bottom: 30px;
      }
    }

    &-subtitle {
      display: block;
      font-weight: 400;
      font-size: 16px;
      line-height: 150%;
      color: $blackTextColor;
      text-align: center;
      margin-bottom: 30px;

      @include onDesktop {
        text-align: left;
        margin-bottom: 50px;
      }
    }

    &-button {
      margin: 0 auto;

      @include onDesktop {
        margin: 0;
      }
    }

    &-img {
      display: block;
      width: 100%;
      margin-bottom: 25px;

      @include onTablet {
        margin-bottom: 50px;
      }

      @include onDesktop {
        position: absolute;
        top: 0;
      }

      transition: all 0.3s;
      &:hover {
        scale: 105%;
      }
    }
  }
}

sources.styles/mixins.scss:
@mixin onDesktop {
  @media (min-width: 1280px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 768px) and (max-width: 1279px) {
    @content;
  }
}

@mixin learnMoreLink {
  display: block;
  max-width: max-content;
  text-decoration: none;
  font-style: normal;
  font-weight: 500;
  font-size: 14px;
  line-height: 130%;
  color: $greenBgColor;
