        background-position: center;
      }
    }
  }

  &__nav {
    display: flex;
    flex-direction: column;
    list-style: none;
    gap: 10px;
    padding: 0;
    margin-bottom: 40px;

    @include onTablet {
      gap: 15px;
      margin-bottom: 0;
    }

    @include onDesktop {
      flex-direction: row;
      gap: 40px;
      margin-bottom: 0;
    }

    &-link {
      font-weight: 500;
      font-size: 18px;
      line-height: 150%;
      text-transform: capitalize;
      color: $whiteTextColor;
      text-decoration: none;

      @include onTablet {
        font-size: 14px;
        font-weight: 400;
      }

      &:hover {
        text-decoration: underline;
      }
    }
  }

  &__info {
    display: flex;
    flex-direction: column;
    gap: 10px;
    position: relative;

    @include onTablet {
      gap: 7px;
    }

    @include onDesktop {
      transform: translateY(-24px);
      gap: 20px;
    }

    &-link {
      text-decoration: none;
      color: $whiteTextColor;
      font-weight: 400;
      font-size: 14px;
      line-height: 150%;

      @include onDesktop {
        font-size: 16px;
      }

      &:hover {
        text-decoration: underline;
      }
    }
  }

  &__credits {
    font-weight: 400;
    font-size: 14px;
    line-height: 150%;
    color: $whiteTextColor;
    position: absolute;
    bottom: 0;
    left: 50%;
    transform: translate(-50%);
    text-align: center;

    @include onTablet {
      position: absolute;
      bottom: 0;
      left: 27px;
      transform: translate(0);
      text-align: left;
    }

    @include onDesktop {
      position: relative;
      margin-top: 160px;
      text-align-last: left;
    }
  }
}

